import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Menu, X, ChevronDown } from 'lucide-react';

const Header = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const [isProductMenuOpen, setIsProductMenuOpen] = useState(false);

  const navigation = [
    {
      name: 'テンプレート',
      href: '/templates',
      submenu: [
        { name: '新入社員研修', href: '/templates?category=新人教育' },
        { name: 'リーダーシップ', href: '/templates?category=リーダーシップ' },
        { name: '営業スキル', href: '/templates?category=営業スキル' },
        { name: 'マーケティング', href: '/templates?category=マーケティング' },
      ]
    },
    { name: '料金プラン', href: '/#pricing' },
    { name: '導入事例', href: '/#case-studies' },
    { name: 'よくある質問', href: '/#faq' },
  ];

  return (
    <header className="bg-white">
      <nav className="mx-auto max-w-7xl px-4 sm:px-6 lg:px-8" aria-label="Top">
        <div className="flex w-full items-center justify-between border-b border-gray-200 py-6">
          <div className="flex items-center">
            <Link to="/" className="flex items-center">
              <span className="text-2xl font-bold text-blue-600">研修一括つくるくん</span>
            </Link>
            <div className="ml-10 hidden space-x-8 lg:block">
              {navigation.map((item) => (
                <div key={item.name} className="relative inline-block text-left">
                  {item.submenu ? (
                    <div>
                      <button
                        type="button"
                        className="inline-flex items-center text-base font-medium text-gray-500 hover:text-gray-900"
                        onClick={() => setIsProductMenuOpen(!isProductMenuOpen)}
                      >
                        {item.name}
                        <ChevronDown className="ml-2 h-4 w-4" />
                      </button>
                      {isProductMenuOpen && (
                        <div className="absolute z-10 mt-3 w-48 rounded-md bg-white shadow-lg ring-1 ring-black ring-opacity-5">
                          <div className="py-1" role="menu">
                            {item.submenu.map((subitem) => (
                              <Link
                                key={subitem.name}
                                to={subitem.href}
                                className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                                role="menuitem"
                              >
                                {subitem.name}
                              </Link>
                            ))}
                          </div>
                        </div>
                      )}
                    </div>
                  ) : (
                    <Link
                      to={item.href}
                      className="text-base font-medium text-gray-500 hover:text-gray-900"
                    >
                      {item.name}
                    </Link>
                  )}
                </div>
              ))}
            </div>
          </div>
          <div className="ml-10 space-x-4">
            <Link
              to="/login"
              className="inline-block rounded-md border border-transparent bg-white px-4 py-2 text-base font-medium text-blue-600 hover:bg-gray-50"
            >
              ログイン
            </Link>
            <Link
              to="/signup"
              className="inline-block rounded-md border border-transparent bg-blue-600 px-4 py-2 text-base font-medium text-white hover:bg-blue-700"
            >
              無料で始める
            </Link>
          </div>
          <div className="ml-4 lg:hidden">
            <button
              type="button"
              className="inline-flex items-center justify-center rounded-md p-2 text-gray-400 hover:bg-gray-100 hover:text-gray-500"
              onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
            >
              <span className="sr-only">メニューを開く</span>
              {isMobileMenuOpen ? (
                <X className="h-6 w-6" />
              ) : (
                <Menu className="h-6 w-6" />
              )}
            </button>
          </div>
        </div>

        {/* モバイルメニュー */}
        {isMobileMenuOpen && (
          <div className="lg:hidden">
            <div className="space-y-1 px-2 pb-3 pt-2">
              {navigation.map((item) => (
                <div key={item.name}>
                  {item.submenu ? (
                    <>
                      <button
                        className="block w-full text-left px-3 py-2 text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsProductMenuOpen(!isProductMenuOpen)}
                      >
                        {item.name}
                        <ChevronDown className="ml-2 inline-block h-4 w-4" />
                      </button>
                      {isProductMenuOpen && (
                        <div className="pl-4">
                          {item.submenu.map((subitem) => (
                            <Link
                              key={subitem.name}
                              to={subitem.href}
                              className="block px-3 py-2 text-base font-medium text-gray-500 hover:bg-gray-50"
                            >
                              {subitem.name}
                            </Link>
                          ))}
                        </div>
                      )}
                    </>
                  ) : (
                    <Link
                      to={item.href}
                      className="block px-3 py-2 text-base font-medium text-gray-700 hover:bg-gray-50"
                    >
                      {item.name}
                    </Link>
                  )}
                </div>
              ))}
              <div className="border-t border-gray-200 pt-4 pb-3">
                <div className="space-y-2">
                  <Link
                    to="/login"
                    className="block w-full rounded-md px-3 py-2 text-center text-base font-medium text-gray-700 hover:bg-gray-50"
                  >
                    ログイン
                  </Link>
                  <Link
                    to="/signup"
                    className="block w-full rounded-md bg-blue-600 px-3 py-2 text-center text-base font-medium text-white hover:bg-blue-700"
                  >
                    無料で始める
                  </Link>
                </div>
              </div>
            </div>
          </div>
        )}
      </nav>
    </header>
  );
};

export default Header;
